import React from "react";
import Navbar from "./components/Navbar";
import { Switch, Route } from "react-router-dom";

const Home = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <p>Welcome to </p>
        <h1>Technosoft Hunter:</h1>
        <p>Your Premier Destination for Professional Website Design Services</p>
      </section>
    </>
  );
};

const About = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <p>Welcome to </p>
        <h1>Technosoft Hunter:</h1>
        <p>Your Premier Destination for Professional Website Design Services</p>

      </section>
    </>
  );
};

const Service = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <p>Welcome to </p>
        <h1>Technosoft Hunter:</h1>
        <p>Your Premier Destination for Professional Website Design Services</p>
      </section>
    </>
  );
};



const App = () => {
  return (
    <Switch>
      <Route exact path="/">
        <Home />
      </Route>

      <Route path="/about">
        <About />
      </Route>

      <Route path="/service">
        <Service />
      </Route>


    </Switch>
  );
};

export default App;
